import React from "react";
import firebase from "firebase/app";

const signOut = () => {
  firebase
    .auth()
    .signOut()
    .then(function () {
      console.log("Successufully Signed out");
    })
    .catch(function () {
      console.log("Error Signed out");
    });
};
const Profiles = () => {
  return (
    <div>
      <h1>Profiles page</h1>
      <button onClick={signOut}>Signout</button>
    </div>
  );
};

export default Profiles;
